// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import HeroSection from './components/HeroSection';
import Search from './components/Search';
import './App.css';

const App = () => {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          <Route path="/about-us" element={<HeroSection />} />
          <Route path="/search-companies" element={<Search type="Company" />} />
          <Route path="/search-funds" element={<Search type="Fund" />} />
          <Route path="/sell-overpaid-ceo" element={<div>Sell the Overpaid CEO Virtual Portfolio Page</div>} />
          <Route path="/" element={<Home />} />
        </Routes>
      </div>
    </Router>
  );
};

const Home = () => (
  <>

    {/* Additional components or content for the home page can be added here */}
  </>
);

export default App;
